import React from 'react';
import styled from 'styled-components';
import { useState, useEffect } from 'react';

const PageContainter = styled.div`
    display: flex;
    height: 100vh;
    justify-content: center;
    background-color: #2e2e3b;
    background-image: 
        radial-gradient(at 47% 33%,#000000 0, transparent 59%), 
        radial-gradient(at 82% 65%,#b80077), transparent 55%);

`;
const Card = styled.div`
    backdrop-filter: blur(25px) saturate(200%);
    -webkit-backdrop-filter: blur(25\px) saturate(200%);
    background-color: #b206d42b;
    border: 2px solid #ffffff1f;
    height: 400px;  
    border-radius: 8%;
    overflow: hidden;
    text-decoration: none;
    margin: 20p;
    padding: 20px;
`;

const Image = styled.img`
    width: 320px;
    height: 320px;
    border-radius: 8%;
`;


function App() {
  const [cards, setCards] = useState();
  const fetchData = async () => {
    fetch("https://api.thecatapi.com/v1/images/search", {
      headers: {
        "Content-Type": "application/json",
        "x-api-key": "a1dd61b4-b654-4001-a4f4-5ec7c2386882"
      }
    })
      .then(response => {
        response.json().then(data => {
          setCards(data[0].url);
          console.log(data[0]);
        })
          .catch(error => console.log(error))
      })

  }

  useEffect(() => {
    fetchData();
  }, [])

  return (
    <PageContainter>
      <Card>
        <Image src={cards} />
      </Card>
    </PageContainter>
  );
};

export default App;
